import styles from "./button.module.scss";

const cx = classNames.bind(styles);

function Button({ to, href, onClick, children }) {
  let Comp = "button";

  const classes = cx("wrapper");
  return 
  <Comp classNames={classes}>
    <span>{}</span>
  </Comp>;
}

export default Button;
